import Header from "../components/Header";
import Footer from "../components/Footer";

const Home = () => {
  return (
    <div>
      <Header />
      <div className="text-center py-20 bg-blue-100 min-h-screen">
        <h1 className="text-4xl font-bold text-blue-700">Welcome to Dream Fest 2K25</h1>
        <p className="mt-4 text-lg">Book your tickets now and be part of the biggest college fest!</p>
      </div>
      <Footer />
    </div>
  );
};

export default Home;
